import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { ChevronDown, ChevronUp, Code, BarChart2, Heart } from 'lucide-react';

const HackathonMainPage = () => {
  const [isTracksExpanded, setIsTracksExpanded] = useState(false);

  return (
    <div className="flex min-h-screen bg-gray-100">
      {/* Left Navigation Pane */}
      <nav className="w-64 bg-white shadow-md fixed h-full overflow-y-auto">
        <div className="p-5">
          <h2 className="text-2xl font-bold mb-5">Hackathon 2024</h2>
          <ul className="space-y-2">
            <li><Link to="/dashboard" className="block py-2 px-4 hover:bg-gray-100">Dashboard</Link></li>
            <li><Link to="/schedule" className="block py-2 px-4 hover:bg-gray-100">Schedule</Link></li>
            <li><Link to="/resources" className="block py-2 px-4 hover:bg-gray-100">Resources</Link></li>
            <li>
              <button 
                className="flex items-center justify-between w-full py-2 px-4 hover:bg-gray-100"
                onClick={() => setIsTracksExpanded(!isTracksExpanded)}
              >
                Tracks
                {isTracksExpanded ? <ChevronUp size={20} /> : <ChevronDown size={20} />}
              </button>
              {isTracksExpanded && (
                <ul className="pl-4">
                  <li><Link to="/tracks/classic" className="flex items-center py-2 px-4 hover:bg-gray-100"><Code size={16} className="mr-2" /> Classic Track</Link></li>
                  <li><Link to="/tracks/enterprise" className="flex items-center py-2 px-4 hover:bg-gray-100"><BarChart2 size={16} className="mr-2" /> Enterprise Track</Link></li>
                  <li><Link to="/tracks/valentines" className="flex items-center py-2 px-4 hover:bg-gray-100"><Heart size={16} className="mr-2" /> Valentines Track</Link></li>
                </ul>
              )}
            </li>
            <li><Link to="/submissions" className="block py-2 px-4 hover:bg-gray-100">My Submissions</Link></li>
            <li><Link to="/profile" className="block py-2 px-4 hover:bg-gray-100">Profile</Link></li>
          </ul>
        </div>
      </nav>

      {/* Main Content Area */}
      <main className="flex-grow ml-64 p-8">
        <h1 className="text-3xl font-bold mb-6">Welcome to Hackathon 2024</h1>
        {/* Add more content for the main area */}
      </main>
    </div>
  );
};

export default HackathonMainPage;
